// FileList.js
import React from 'react';

const FileList = ({ items }) => {
  return (
    <ul>
      {items.map((item, index) => {
        if (item.isEditable) {
          return (
            <li key={index}>
              <input
                type="text"
                defaultValue={item.name}
              />
              - uploaded on
              <input
                type="date"
                defaultValue={item.date}
              />
            </li>
          );
        }
        return (
          <li key={index}>
            {item.name} - uploaded on {item.date}
          </li>
        );
      })}
    </ul>
  );
};

export default FileList;
